window.bookSummaryJSON = "<p>Destiny not only arrives, but nearly kicks my butt.</p> <p>Even though my foundation has been shaken, Aidan stays by my side, and together, we take the next steps to end the curse. We’ve found four other marked girls like me, but we’re still missing pieces to the puzzle...pieces that are critical for success.</p> <p>As the marked girls and I learn to work together, the truth surrounding the Hallowed Guild comes to light.</p> <p>Armed with this new knowledge, it’s time to take action and right the balance of power. To make choices that we’ll be forced to live with. One thing is certain - when we’re through, our world will never be the same.</p> <p>If you can't get enough of books by K.F. Breene, Kelly St. Claire, Annette Marie, Shannon Mayer, Leia Stone, Jaymin Eve, and Laura Thalassa, then you'll love this paranormal romance.</p> <p>Purchase <i>Broken Curse</i> now.</p>"; 
